(1, 'AAAADCXBTBU:APA91bFLD3BdccE4tSs8sO0GBgK0erfAJDto-EacU5K4Dj-qp6kuPPyA3a7o-Gp0H5gH0H683vrpJ0Ussj06qEvELOuq8j8y5ndPPgGW9nSdNRRIvwWDGqfKqO6qWIVyqpdMV1L3AMgl', 'bbydRmaPTr08BSCHsGxV1jIKp5uLzEbXWMi34JvAolFZwqD', 0, 'My Pro VPN App', '6677-2022-09-19.png', 'info@bytesbee.com', '1.0', 'Prashant Adesara', '+91 82002 54187', 'https://bytesbee.com', 'BytesBee', '<p>My Pro VPN is a lightning-fast app that provides free VPN service. VPN encrypts your Internet connection so that third parties can&rsquo;t track your online activity, Most servers are free to use, you can click the flag and change the server at any time as you want.</p>\n\n<p><b>The best unlimited free VPN client for android. Free VPN proxy for office, school, home, or traveling abroad to unblock sites, access your favorite mobile game, secure WiFi hotspot, and protect privacy.</b></p>\n\n<ul>\n	<li>A large number of servers, high-speed bandwidth</li>\n	<li>Choose apps that use VPN (Android 5.0+ required)</li>\n	<li>Works with Wi-Fi, 5G, LTE/4G, 3G, and all mobile data carriers</li>\n	<li>Strict no-logging policy</li>\n	<li>Smart choose server</li>\n	<li>Well-designed UI, a few ADs</li>\n	<li>No usage and time limit</li>\n	<li>No registration or configuration is required</li>\n	<li>No additional permissions are required</li>\n	<li>Tiny size, and safer</li>\n</ul>\n\n<p><span dir=\"ltr\">My Pro VPN Application is designed and developed by BytesBee(INDIA), for more Applications contact info@bytesbee.com</span></p>\n\n<p><span dir=\"ltr\">Website: https://www.bytesbee.com</span></p>\n\n<p><span dir=\"ltr\">We also develop custom applications, if you need any kind of custom application contact us on the given Email or Contact No.</span></p>\n\n<p>\n<span dir=\"ltr\"><strong>Email:</strong> info@bytesbee.com</span><br />\n<span dir=\"ltr\"><strong>WhatsApp:</strong> +91 82002 54187</span><br />\n<span dir=\"ltr\"><strong>Website:</strong> https://www.bytesbee.com</span></p>', '<p>Effective date: July 21, 2022</p>\r\n\r\n<p>BytesBee (&quot;us&quot;, &quot;we&quot;, or &quot;our&quot;) operates the https://www.bytesbee.com website and the My VPN app mobile application (the &quot;Service&quot;).</p>\r\n\r\n<p>This page informs you of our policies regarding the collection, use, and disclosure of personal data when you use our Service and the choices you have associated with that data.</p>\r\n\r\n<p>We use your data to provide and improve the Service. By using the Service, you agree to the collection and use of information under this policy. Unless otherwise defined in this Privacy Policy, terms used in this Privacy Policy have the same meanings as in our Terms and Conditions.</p>\r\n\r\n<h2>Information Collection And Use</h2>\r\n\r\n<p>We collect several different types of information for various purposes to provide and improve our Service to you.</p>\r\n\r\n<h3>Types of Data Collected</h3>\r\n\r\n<h4>Personal Data</h4>\r\n\r\n<p>While using our Service, we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you (&quot;Personal Data&quot;). Personally, identifiable information may include, but is not limited to:</p>\r\n\r\n<ul>\r\n	<li>Email address</li>\r\n	<li>Cookies and Usage Data</li>\r\n</ul>\r\n\r\n<h4>Usage Data</h4>\r\n\r\n<p>We may also collect information that your browser sends whenever you visit our Service or when you access the Service by or through a mobile device (&quot;Usage Data&quot;).</p>\r\n\r\n<p>This Usage Data may include information such as your computer&#39;s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that you visit, the time and date of your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p>When you access the Service by or through a mobile device, this Usage Data may include information such as the type of mobile device you use, your mobile device unique ID, the IP address of your mobile device, your mobile operating system, the type of mobile Internet browser you use, unique device identifiers and other diagnostic data.</p>\r\n\r\n<h4>Tracking &amp; Cookies Data</h4>\r\n\r\n<p>We use cookies and similar tracking technologies to track the activity on our Service and hold certain information.</p>\r\n\r\n<p>Cookies are files with a small amount of data which may include an anonymous unique identifier. Cookies are sent to your browser from a website and stored on your device. Tracking technologies also used are beacons, tags, and scripts to collect and track information and to improve and analyze our Service.</p>\r\n\r\n<p>You can instruct your browser to refuse all cookies or to indicate when a cookie is being sent. However, if you do not accept cookies, you may not be able to use some portions of our Service.</p>\r\n\r\n<p>Examples of Cookies we use:</p>\r\n\r\n<ul>\r\n	<li><strong>Session Cookies.</strong> We use Session Cookies to operate our Service.</li>\r\n	<li><strong>Preference Cookies.</strong> We use Preference Cookies to remember your preferences and various settings.</li>\r\n	<li><strong>Security Cookies.</strong> We use Security Cookies for security purposes.</li>\r\n</ul>\r\n\r\n<h2>Use of Data</h2>\r\n\r\n<p>BytesBee uses the collected data for various purposes:</p>\r\n\r\n<ul>\r\n	<li>To provide and maintain the Service</li>\r\n	<li>To notify you about changes to our Service</li>\r\n	<li>To allow you to participate in interactive features of our Service when you choose to do so</li>\r\n	<li>To provide customer care and support</li>\r\n	<li>To provide analysis or valuable information so that we can improve the Service</li>\r\n	<li>To monitor the usage of the Service</li>\r\n	<li>To detect, prevent and address technical issues</li>\r\n</ul>\r\n\r\n<h2>Transfer Of Data</h2>\r\n\r\n<p>Your information, including Personal Data, may be transferred to &mdash; and maintained on &mdash; computers located outside of your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from your jurisdiction.</p>\r\n\r\n<p>If you are located outside India and choose to provide information to us, please note that we transfer the data, including Personal Data, to India and process it there.</p>\r\n\r\n<p>Your consent to this Privacy Policy followed by your submission of such information represents your agreement to that transfer.</p>\r\n\r\n<p>BytesBee will take all steps reasonably necessary to ensure that your data is treated securely and under this Privacy Policy and no transfer of your Personal Data will take place to an organization or a country unless there are adequate controls in place including the security of your data and other personal information.</p>\r\n\r\n<h2>Disclosure Of Data</h2>\r\n\r\n<h3>Legal Requirements</h3>\r\n\r\n<p>BytesBee may disclose your Data in the good faith belief that such action is necessary to:</p>\r\n\r\n<ul>\r\n	<li>To comply with a legal obligation</li>\r\n	<li>To protect and defend the rights or property of BytesBee</li>\r\n	<li>To prevent or investigate possible wrongdoing in connection with the Service</li>\r\n	<li>To protect the personal safety of users of the Service or the public</li>\r\n	<li>To protect against legal liability</li>\r\n</ul>\r\n\r\n<h2>Security Of Data</h2>\r\n\r\n<p>The security of your data is important to us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While we strive to use commercially acceptable means to protect your Personal Data, we cannot guarantee its absolute security.</p>\r\n\r\n<h2>Service Providers</h2>\r\n\r\n<p>We may employ third party companies and individuals to facilitate our Service (&quot;Service Providers&quot;), to provide the Service on our behalf, to perform Service-related services or to assist us in analyzing how our Service is used.</p>\r\n\r\n<p>These third parties have access to your Personal Data only to perform these tasks on our behalf and are obligated not to disclose or use it for any other purpose.</p>\r\n\r\n<h2>Links To Other Sites</h2>\r\n\r\n<p>Our Service may contain links to other sites that are not operated by us. If you click on a third party link, you will be directed to that third party&#39;s site. We strongly advise you to review the Privacy Policy of every site you visit.</p>\r\n\r\n<p>We have no control over and assume no responsibility for the content, privacy policies, or practices of any third party sites or services.</p>\r\n\r\n<h2>Children&#39;s Privacy</h2>\r\n\r\n<p>Our Service does not address anyone under the age of 18 (&quot;Children&quot;).</p>\r\n\r\n<p>We do not knowingly collect personally identifiable information from anyone under the age of 18. If you are a parent or guardian and you are aware that your Children has provided us with Personal Data, please contact us. If we become aware that we have collected Personal Data from children without verification of parental consent, we take steps to remove that information from our servers.</p>\r\n\r\n<h2>Changes To This Privacy Policy</h2>\r\n\r\n<p>We may update our Privacy Policy from time to time. We will notify you of any changes by posting the new Privacy Policy on this page.</p>\r\n\r\n<p>We will let you know via email and/or a prominent notice on our Service, before the change becoming effective and update the &quot;effective date&quot; at the top of this Privacy Policy.</p>\r\n\r\n<p>You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</p>\r\n\r\n<h2>Contact Us</h2>\r\n\r\n<p>If you have any questions about this Privacy Policy, please contact us:</p>\r\n\r\n<ul>\r\n	<li>By email: info@bytesbee.com</li>\r\n	<li>By visiting this page on our website: https://bytesbee.com/contact</li>\r\n</ul>\r\n', 'ca-app-pub-4801125099042575~9621541841', 1, 'ca-app-pub-3940256099942544/1033173712', '0', 1, 'ca-app-pub-3940256099942544/6300978111', 1, 'ca-app-pub-3940256099942544/2247696110', 1, 1, 'New Version Available!', 'Please download the latest version to continue using the app and get new features.', 'Update', 'Exit', 'Playstore', '', 'AIzaSyBU19ln9W1W85olmtWIUZpGGLlY9JcOroA', 'LTR', '2018-10-20 15:00:00', '2022-10-11 13:14:00');

